import { client } from "./client";

export const getHerson = async () => {

    try{
        const entries  = await client.getEntries({
            content_type: "productoOpemindTools",
        });
        return entries;
    } catch(error){
        console.log(error);
    }
};

export const { usegetHerson } = getHerson;
